import SearchBar from "../SearchBar/SearchBar";
import style from "./Menu.module.css"
import Dropdown from 'react-bootstrap/Dropdown';
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';

const Menu = () => {

    return (

        <div className={style.div}>
            <SearchBar />
            <Dropdown>
                <Dropdown.Toggle variant="secondary" id="dropdown-basic">
                    CERVECERIA
                </Dropdown.Toggle>

                <Dropdown.Menu>
                    <Dropdown.Item href="#/action-1">Stella</Dropdown.Item>
                    <Dropdown.Item href="#/action-2">Brahma</Dropdown.Item>
                    <Dropdown.Item href="#/action-3">Corona</Dropdown.Item>
                </Dropdown.Menu>
            </Dropdown>

            <Dropdown>
                <Dropdown.Toggle variant="secondary" id="dropdown-basic">
                    CHUCHERIA
                </Dropdown.Toggle>
                <Dropdown.Menu>
                    <Dropdown.Item href="#/action-1">CHINATOW</Dropdown.Item>
                    <Dropdown.Item href="#/action-2">SPARKY</Dropdown.Item>
                    <Dropdown.Item href="#/action-3">FRANCACHELA</Dropdown.Item>
                </Dropdown.Menu >
            </Dropdown >

            <Dropdown>
                <Dropdown.Toggle variant="secondary" id="dropdown-basic">
                    MATIAS
                </Dropdown.Toggle>
                <Dropdown.Menu>
                    <Dropdown.Item href="#/action-1">ELbObIS</Dropdown.Item>
                    <Dropdown.Item href="#/action-2">ELbELLACO</Dropdown.Item>
                    <Dropdown.Item href="#/action-3">ELpERFECTO</Dropdown.Item>
                </Dropdown.Menu>
            </Dropdown>
        </div >

    );
}


export default Menu;




